import React from 'react';
import { connect } from 'react-redux';
import { getVehicles } from './redux/vehicleDatabase';
import './assets/scss/database.scss';

class Database extends React.Component {
    componentDidMount() {
        this.props.getVehicles();
    }
    showVehicles = () => {
        return this.props.vehicleDatabase.map(vehicle => (
            <div key="vehicle._id" className="database-container">
                <div className="database-row">
                    <p> Make: </p>
                    <p> {vehicle.make} </p>
                </div>
                <div className="database-row">
                    <p> Model: </p>
                    <p> {vehicle.model} </p>
                </div>
                <div className="database-row">
                    <p> Trim: </p>
                    <p> {vehicle.style} </p>
                </div>
                <div className="database-row">
                    <p> UVC: </p>
                    <p> {vehicle.uvc} </p>
                </div>
                <div className="database-row">
                    <p> VIN: </p>
                    <p> {vehicle.vin} </p>
                </div>
                <div className="database-row">
                    <p> MILES: </p>
                    <p> {vehicle.miles} </p>
                </div>
                <div className="database-row">
                    <p> Images: </p>
                    <p> {vehicle.files.map(file => (
                        <img src={file} className="" alt=""/>
                        ))} </p>
                </div>
                <div className="database-row">
                    <p> Name: </p>
                    <p> {vehicle.name} </p>
                </div>
                <div className="database-row">
                    <p> Email: </p>
                    <p> {vehicle.from} </p>
                </div>
                <div className="database-row">
                    <p> Phone: </p>
                    <p> {vehicle.phone} </p>
                </div>
                <div className="database-row">
                    <p> ZIP: </p>
                    <p> {vehicle.zip} </p>
                </div>
            </div>
        ))
    }
    render() {
        console.log(this.props);
        return (
            <div>
                {this.showVehicles()}
            </div>
        )
    }
}

export default connect(state => state, { getVehicles })(Database)
